import React, { Component } from 'react';
import Habit from './habit';

class Habits extends Component {
    state = {
        habits: [
            {name: 'Reading',count:0},
            {name: 'Runing',count:0},
            {name: 'Coding',count:0},

        ]
    }
    render() {
        return (
            <ul>
                {
                    this.state.habits.map(item =>(
                        <Habit habit={item}/>
                    ))
                }
            </ul>
        );
    }
}

export default Habits;
